  <BannerContainer>

  <BannerPicture>
    <source type="image/webp" srcset="https://firebasestorage.googleapis.com/v0/b/definition-music-and-mastering.appspot.com/o/images%2FBanner-Background.webp?alt=media&token=64576274-d4d7-4723-870d-33f65b651976" />
    <source type="image/jp2" srcset="../../images/JP2Files/Banner-Background.jp2" />
    <source type="image/jxr" srcset="../../images/JXRFiles/Banner-Background.jxr" />
    <img src="../" alt="alt description" />
 </BannerPicture>

    <BannerTextBackground>
      <BannerText>HYBRID MIXING & MASTERING SOLUTIONS | Beats By DJ Definition & Other Producers | Artist Promotions</BannerText>
    </BannerTextBackground>
  </BannerContainer>

);

export default React.memo(Banner);
